// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "../node_modules/@openzeppelin/contracts/token/ERC20/IERC20.sol";
import '../node_modules/@openzeppelin/contracts/token/ERC1155/IERC1155.sol';
import "../node_modules/@openzeppelin/contracts/token/ERC1155/utils/ERC1155Holder.sol";

contract PBProShopEquippedHolder is ERC1155Holder{
    
    address public admin;
    IERC1155 private pbproshopfactoryaddress;
    IERC1155 private pbproshopholderaddress;
    IERC20 public buddies;
        
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only Admin can perform this call");
        _;
    }

    constructor(address _buddiesCoinAddress, address _pbproshopfactoryaddress, address _pbproshopholderaddress) ERC1155Holder() {
        admin = msg.sender;
        buddies = IERC20(_buddiesCoinAddress);
        pbproshopfactoryaddress = IERC1155(_pbproshopfactoryaddress);
        pbproshopholderaddress = IERC1155(_pbproshopholderaddress);
    }

    function getPBProShopEquippedHolderAddress() public view returns (address) {
        return address(this);
    }
    
   function updateProShopFactoryAddress(address _pbproshopfactoryaddress) external onlyAdmin {
       pbproshopfactoryaddress = IERC1155(_pbproshopfactoryaddress);
   }

    function updateProShopHolderAddress(address _pbproshopholderaddress) external onlyAdmin {
       pbproshopholderaddress = IERC1155(_pbproshopholderaddress);
   }

   //function returnEquippedItem  
    
    
}
